import React from "react";
import "./MenuPersona.css"



function MenuPersona(): JSX.Element {
    return (
      <div>
        <label className="barra">Menu Personal</label>
          <button style = {{position: 'absolute', top: 200, left: 700, fontSize: 25, fontWeight: 'bold'}} className = 'botonMenuPersona'> Registrar Personal </button>
          <button style = {{position: 'absolute', top: 350, left: 700, fontSize: 25, fontWeight: 'bold'}} className = 'botonMenuPersona'> Eliminar Personal </button>
          <button style = {{position: 'absolute', top: 500, left: 700, fontSize: 25, fontWeight: 'bold'}} className = 'botonMenuPersona'> Editar Personal </button>
          <button className = 'botonVolver'> Volver </button>
      </div>

    );
  }

  export default MenuPersona;
